(41, 'Bienvenue sur Joomla!', '<div style="padding: 0 5px 0 5px; text-align: justify;"><p style="border: medium none;">Vous avez choisi le système de gestion de contenu Joomla, félicitations ! Pour vous aider à démarrer, consultez ces ressources officielles afin de sécuriser votre serveur,  ainsi que ces liens sur de la documentation et autres ressources utiles.<strong><br /><br />Sécurité<br /></strong>Sur l''Internet, la sécurité est toujours un sujet de préoccupation. Pour cette raison, nous vous invitons à vous abonner aux <a href="http://feedburner.google.com/fb/a/mailverify?uri=JoomlaSecurityNews" target="_blank">annonces de sécurité de Joomla!</a> pour obtenir les dernières informations sur les mises à jour et les nouveautés de Joomla. Ces annonces vous seront envoyées automatiquement par email.</p>\r\n<p style="border: medium none ; padding: 0cm;">Si c''est votre premier site Web, ces informations de sécurité peuvent vous paraître compliquées et intimidantes. Sachez qu''il y a trois étapes simples à mettre en œuvre pour sécuriser votre site : (1.) des sauvegardes régulières, (2.) appliquer les dernières <a href="http://www.joomla.org/download.html" target="_blank">mises à jour de Joomla</a> dès leur sortie. (3.) <a href="http://docs.joomla.org/Security_Checklist_2_-_Hosting_and_Server_Setup" target="_blank">un 	bon hébergeur</a>. Vous en apprendrez davantage en allant sur la <a href="http://docs.joomla.org/Category:Security_Checklist" target="_blank">liste de vérification de sécurité de Joomla</a></p>\r\n<p style="border: medium none ; padding: 0cm;">Si vous pensez que votre site Web a été attaqué, ou si vous pensez que vous avez découvert un problème de sécurité dans Joomla, nous vous demandons de ne pas le dire sur les forums de Joomla. La publication de cette information pourrait provoquer des risques de sécurité pour les autres sites dans la mesure ou des personnes mal intentionnées pourraient s''en servir. Il vaut donc mieux indiquer d''éventuelles failles de sécurité directement à  <a href="http://developer.joomla.org/security/contact-the-team.html" target="_blank">l''équipe de sécurité Joomla</a>.<strong><br /><br />Se former sur Joomla<br /></strong>Un bon endroit pour commencer à apprendre à utiliser Joomla est le "<a href="http://aide.joomla.fr/">site d''aide de Joomla.fr</a>" ou le  "<a href="http://docs.joomla.org/beginners" target="_blank">Absolute Beginner''s Guide to Joomla</a>". Là, vous trouverez un <a href="http://help.joomla.org/ghop/feb2008/task048/joomla_15_quickstart.pdf" target="_blank">guide</a> et des <a href="http://help.joomla.org/ghop/feb2008/task167/index.html" target="_blank">vidéos</a> pour un démarrage rapide avec Joomla, ainsi que d''autres tutoriels. Le <a href="http://magazine.joomla.org" target="_blank">Joomla Community Magazine</a> contient également des articles pour débutants et pour des utilisateurs expérimentés. Un autre endroit pour trouver des réponses est la <a href="http://docs.joomla.org/Category:FAQ" target="_blank">Foire aux questions (FAQ)</a>. Si vous êtes bloqué sur un écran dans l''Administration (là où vous vous trouvez actuellement), essayez de cliquer sur le bouton de barre d''outils « Aide » de façon à obtenir une aide spécifique à cette page.</p>\r\n<p style="border: medium none ; padding: 0cm;">Si vous avez encore des questions, n''hésitez pas à utiliser les <a href="http://forum.joomla.fr/" target="_blank">Forums de Joomla</a>. Ces forums sont une ressource extrêmement précieuse pour les utilisateurs de Joomla de tous niveaux! Cependant, n''oubliez pas avant de poser votre question sur le forum, d''utiliser le moteur de recherche situé en haut à droite de chaque forum. Il fort possible que d''autres aient rencontré le même problème et qu''il ait été réglé.</p>\r\n<p style="border: medium none ; padding: 0cm;"><strong>Participez</strong></p>\r\n<p style="border: medium none ; padding: 0cm;"><a name="twjs"></a>Si vous voulez nous aider à améliorer Joomla, n''hésitez pas à participer. Il y a de nombreuses façons de le faire... Amusez-vous bien avec Joomla !</p></div>', 0, 'cpanel', 0, '0000-00-00 00:00:00', 1, 'mod_custom', 0, 2, 1, 'moduleclass_sfx=\n\n', 1, 1, ''),
