INSERT INTO `jos_ckforms` (`id`, `name`, `title`, `description`, `emailfrom`, `emailto`, `emailcc`, `emailbcc`, `subject`, `created`, `created_by`, `hits`, `published`, `saveresult`, `emailresult`, `textresult`, `redirecturl`, `redirectdata`, `captcha`, `captchacustominfo`, `captchacustomerror`, `customjs`, `uploadpath`, `maxfilesize`, `poweredby`, `emailreceipt`, `emailreceipttext`, `emailreceiptsubject`, `emailreceiptincfield`, `emailreceiptincfile`, `emailresultincfile`, `formCSSclass`, `displayip`, `displaydetail`, `fronttitle`, `frontdescription`, `autopublish`) VALUES
(1, 'Enregistrement', 'Enregistrer votre DEA', '<p>Sauvez une vie dans votre région ! AJOUTEZ VOTRE DEA AU RÉSEAU.</p>', 'AED_map', 'thomas.dalpiva@provincedeliege.be,rebecca_tubes@hotmail.com,marjomaraite@gmail.com,tony.hosmans@provincedeliege.be', '', '', 'enregistrement DEA', '2012-10-08 13:27:44', 62, 1553, 1, 1, 1, '<p>Nous vous remercions de votre enregistrement</p>', '', 0, 1, 'Merci de recopier les caractères affichés', 'Les caractères recopiés ne sont pas corrects', NULL, '/homez.548/aedpoint/www/images/stories/photo_formulaire/', 5000000, 0, 1, '<p> </p>\r\n<p>Nous vous remercions d''avoir enregistré votre DEA.</p>\r\n<p>N''hésitez pas à nous faire connaître la présence d''un DEA dans votre région.</p>\r\n<p>Pour plus d''informations, rendez-vous sur <strong><a href="http://emurgency.eu/" target="_blank">WWW.EMURGENCY.EU</a></strong></p>\r\n<p>Soutenez-nous et rejoignez-nous sur <strong><a href="http://www.facebook.com/pages/Oser-Sauver/269422209762113" target="_blank">FACEBOOK OSER SAUVER !</a></strong></p>\r\n<p>A bientôt</p>\r\n<p>Les gestionnaires d''<strong><a href="index.php" target="_blank">AED-POINTER.EU</a></strong></p>', ' Confirmation de votre enregistrement', 0, 0, 1, '', 1, 1, 'enregistrement dea', '<p>Liste des enregistrements</p>', 1),
(3, 'erreur', 'erreur DEA', '<p>Si vous constatez une erreur quelconque concernant un DEA, merci de nous le signaler en complétant le formulaire ci-dessous.</p>', 'AED_map', 'thomas.dalpiva@provincedeliege.be,rebecca_tubes@hotmail.com,marjomaraite@gmail.com,tony.hosmans@provincedeliege.be', '', '', 'enregistrement DEA', '2012-09-17 13:49:33', 62, 799, 1, 1, 1, '<p>Nous vous remercions de votre signalement</p>', '', 0, 1, 'Merci de recopier les caractères affichés', 'Les caractères recopiés ne sont pas corrects', NULL, '/Applications/MAMP/htdocs/osersauver3/tmp/', 1000, 0, 1, '', ' Confirmation de votre enregistrement', 0, 0, 1, '', 1, 1, 'signalement du dea', '<p>Liste des signalements</p>', 1),
(2, 'Signaler', 'Signaler un DEA', '<p>Aidez-nous à recenser les défibrillateurs dans votre région. Pour pouvoir les signaler, vous devez compléter les informations ci-dessous.</p>', 'AED_map', 'thomas.dalpiva@provincedeliege.be,rebecca_tubes@hotmail.com,marjomaraite@gmail.com,tony.hosmans@provincedeliege.be', '', '', 'enregistrement DEA', '2012-09-17 13:49:11', 62, 2216, 1, 1, 1, '<p>Nous vous remercions de votre signalement</p>', '', 0, 1, 'Merci de recopier les caractères affichés', 'Les caractères recopiés ne sont pas corrects', NULL, '/homez.548/aedpoint/www/images/stories/photo_formulaire/', 5000000, 0, 1, '<p>Nous vous remercions d''avoir signalé ce DEA.</p>\r\n<p>N''hésitez pas à nous faire connaître la présence d''autres DEA dans votre région.</p>\r\n<p>Pour plus d''informations, rendez-vous sur <strong><a href="http://emurgency.eu/" target="_blank">WWW.EMURGENCY.EU</a></strong></p>\r\n<p>Soutenez-nous et rejoignez-nous sur <strong><a href="http://www.facebook.com/pages/Oser-Sauver/269422209762113" target="_blank">FACEBOOK OSER SAUVER !</a></strong></p>\r\n<p>A bientôt</p>\r\n<p>Les gestionnaires d''<strong><a href="index.php" target="_blank">AED-POINTER.EU</a></strong></p>', ' Confirmation de votre enregistrement', 0, 0, 1, '', 1, 1, 'signalement du dea', '<p>Liste des signalements</p>', 1),
