(4, 1, '2013-01-20 17:35:53', 'NAMUR EXPO', NULL, NULL, 'Le DEA n''est pas pointé au bon endroit. NAMUR Expo n''est pas au bon endroit sur la carte.', NULL, NULL, NULL, 'Avenue Sergent Virthoff', '5000', 'NAMUR', '', NULL, NULL, 'BE', NULL, NULL, '81.242.149.158', ''),
(5, 1, '2013-01-21 10:26:35', 'Université catholique de Louvain - Halles Universitaires', NULL, NULL, 'Le DEA situé place de l''université n°1 n''est pas bien localisé sur la carte. Il est repris aux auditoires croix du sud alors qu''il est aux halles universitaires, près de la gare de Louvain-la-Neuve. Pourriez-vous modifier sa localisation. Merci d''avance.', NULL, NULL, NULL, 'place de l''université 1', '1348', 'Louvain-la-Neuve', '', NULL, NULL, 'BE', NULL, NULL, '130.104.86.21', ''),
