(10, 1, '2013-08-11 13:49:20', 'ZOLL Benelux', NULL, NULL, 'Vous référez et faites promotions pour le site web www.compareAED.eu . Ce site publie des infos \r\nincorrectes et est géré par Cardiac Sience, un producteur de DEA, donc l''objectivité est très \r\ndiscutable. Veuillez me contacter.', NULL, NULL, NULL, 'Newtonweg 18', '6662', 'Elst, The Netherlands', 'Filip Ghyssaert, Tel. 0032475921674', NULL, NULL, 'NL', NULL, NULL, '178.118.131.253', ''),
(11, 1, '2013-08-13 14:23:58', 'COLGATE PALMOLIVE', NULL, NULL, 'Le marqueur sur votre carte est mal positionné, il pointe la 1ère Avenue, alors que l''Avenue du Parc \r\nIndustriel est située un peu plus à l''ouest, à l''intérieur du triangle formé par les autoroutes.', NULL, NULL, NULL, 'Avenue Parc Industriel 89', '4040', 'Herstal ', '', NULL, NULL, 'BE', NULL, NULL, '212.68.210.34', '');
