(4, 1, '2012-12-16 21:30:52', 'George', 'Christoforakis', 'gchristofo@freemail.gr', '+306936119519 (vodafone mobile)', NULL, 'Other countries', 'Good afternoon, will you add more countries in the list in the future? Thank you. Regards', NULL, NULL, '5.55.158.117', '', NULL),
(5, 1, '2012-12-24 05:06:18', 'Céline', 'Remy', 'celineremy@voo.be', '', NULL, '', 'Madame Monsieur,\r\n\r\nProfesseur en soins infirmiers, je souhaiterais donner le listing de tous les DEA disponnibles en Wallonie à mes étudiants.\r\nSerait-il possible d''obtenir ces informations d''une autre façon que sur la carte géographique de votre site, je ne voudrais pas omettre un appareil en réalisant moi-même ce listing?\r\nD''avance, je vous remercie pour ces précieuses informations.\r\nRemy Céline\r\n', NULL, NULL, '193.190.183.5', '', NULL),
(6, 1, '2013-02-06 00:49:43', 'Florian', 'Beck', 'fbeck@student.ulg.ac.be', '3287853571', NULL, 'Erreur menu', 'Bonjour, \r\nce message pour vous signaler un erreur de traduction ou manque dans un menu en allemand, il est mis signaler et son sous menu "nouveau dea" en francais.\r\nBien à vous \r\nFlorian Beck', NULL, NULL, '85.26.15.67', '', NULL),
(7, 1, '2013-02-13 15:22:58', 'test', 'test', 'test@test.test', '', NULL, '', 'test', NULL, NULL, '193.190.122.30', '', NULL),
(8, 1, '2013-03-12 14:10:46', 'yves', 'BURGRAFF', 'yves.burgraff@gmail.com', '+32495163200', NULL, 'Signalement DEA', 'Je vous ai écrit la semaine dernière pour vous communiquer la présence d''un DEA à 6890 Libin... je ne le retrouve pas sur la carte... Cela nécessite-t-il un délai?\r\nAu plaisir de vous lire', NULL, NULL, '80.201.72.192', '', NULL),
(9, 1, '2013-03-21 14:36:16', 'Jean-Marc', 'Rodeyns', 'mao.long1974@hotmail.com', '+32499219744', NULL, 'DEA à Spa', 'Bonjour, je suis formateur à l''EPAMU, je viens de signaler un DEA à l''office du Tourisme de Spa. J''en ai un autre aussi à Signaler, au centre Sportif Warfa, Avenue A Hesse n°41, dans le Hall Omnisport du bas, mais il risque de faire double lien avec celui de l''ADEPS dans le chateau (en haut de la Fraineuse), celui ci se trouve dans le local conciergerie. bonne journée. Jean-Marc', NULL, NULL, '178.145.53.14', '', NULL),
(10, 1, '2013-05-26 17:48:42', 'DIDIER', 'DHYNES', 'delphinus.dd@gmail.com', '', NULL, 'Colaboration', 'Boujours, il existe une application smart phone similaire à votre site, pourquoi ne pas collaborer. Il s''agit de l''application arrêt cardiaque.', NULL, NULL, '85.201.40.45', '', NULL),
(11, 1, '2013-07-15 13:03:10', 'Georg', 'Antoine', 'georgtun@pt.lu', '', NULL, '', 'Je voudrais demander si vous pourriez actualiser le site aussi avec le Luxembourg.\r\nRemerciments et salutation.', NULL, NULL, '88.207.156.184', '', NULL),
(12, 1, '2013-08-12 14:26:19', 'Henning ', 'Biermann', 'Hbiermann@ukaachen.de', '0049-241-80-37014', NULL, 'AED Position', 'The AED Kármán Auditorium RWTH Aachen, Eilfschonrsteinstr. 15 ist not correct. I''d like to show it in a picture, but I can''t find the possibility to send attachments with this mail. Please let me know your Email-Adress. Or maybe you can include a feature where one can move the AED to the wished position while registering it.\r\nBest regards\r\nHenning\r\n(EMuRgency Team Aachen\r\n', NULL, NULL, '134.61.161.97', '', NULL),
(13, 1, '2013-10-15 11:49:53', 'Lena', 'Lambrecht', 'llambrecht@ukaachen.de', '02418037503', NULL, 'Liste AEDs Aachen', 'Hallo Zusammen,\r\n\r\nanbei habe ich noch eine Liste mit AED Standorten in Aachen.\r\n\r\nViele Grüße,\r\nLena Lambrecht', NULL, NULL, '134.130.15.1', '', '');
