(20, 'Support and Documentation', 'support-and-documentation', '', '<h1>Support </h1><p>Support for the Joomla! CMS can be found on several places. The best place to start would be the <a href="http://docs.joomla.org/" target="_blank" title="Joomla! Official Documentation Wiki">Joomla! Official Documentation Wiki</a>. Here you can help yourself to the information that is regularly published and updated as Joomla! develops. There is much more to come too!</p> <p>Of course you should not forget the Help System of the CMS itself. On the <em>topmenu </em>in the Back-end Control panel you find the Help button which will provide you with lots of explanation on features.</p> <p>Another great place would of course be the <a href="http://forum.joomla.org/" target="_blank" title="Forum">Forum</a> . On the Joomla! Forum you can find help and support from Community members as well as from Joomla! Core members and Working Group members. The forum contains a lot of information, FAQ''s, just about anything you are looking for in terms of support.</p> <p>Two other resources for Support are the <a href="http://developer.joomla.org/" target="_blank" title="Joomla! Developer Site">Joomla! Developer Site</a> and the <a href="http://extensions.joomla.org/" target="_blank" title="Joomla! Extensions Directory">Joomla! Extensions Directory</a> (JED). The Joomla! Developer Site provides lots of technical information for the experienced Developer as well as those new to Joomla! and development work in general. The JED whilst not a support site in the strictest sense has many of the Extensions that you will need as you develop your own Web site.</p> <p>The Joomla! Developers and Bug Squad members are regularly posting their blog reports about several topics such as programming techniques and security issues.</p> <h1>Documentation</h1> <p>Joomla! Documentation can of course be found on the <a href="http://docs.joomla.org/" target="_blank" title="Joomla! Official Documentation Wiki">Joomla! Official Documentation Wiki</a>. You can find information for beginners, installation, upgrade, Frequently Asked Questions, developer topics, and a lot more. The Documentation Team helps oversee the wiki but you are invited to contribute content, as well.</p> <p>There are also books written about Joomla! You can find a listing of these books in the <a href="http://shop.joomla.org/" target="_blank" title="Joomla! Shop">Joomla! Shop</a>.</p>', '', 0, 4, 0, 25, '2008-08-09 08:33:57', 62, '', '2008-08-09 08:33:57', 62, 62, '2012-07-30 19:41:00', '2006-10-07 10:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 13, 0, 2, '', '', 0, 6, 'robots=\nauthor='),
(21, 'Masser', 'masser', '', '<p>Effectuer des compressions  thoraciques <br /><br />Placer vos mains au centre du thorax<br />•<br />Enfoncer fermement le thorax <br /><br /> - Minimum 5 cm de profondeur<br /> - minimum 100 compressions/minute<br />•<br />Relâcher complètement le thorax entre<br />chaque compression thoracique</p>', '', -2, 0, 0, 0, '2008-08-09 16:46:37', 62, '', '2011-12-01 10:56:05', 62, 0, '0000-00-00 00:00:00', '2006-10-07 14:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=0\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 15, 0, 0, '', '', 0, 52, 'robots=\nauthor='),
(48, 'Responsabilités', 'responsabilites', '', 'MENTIONS LÉGALES<br /> <br /> Veuillez avertir systématiquement le centre de secours d’Aide Médicale Urgente 112 en cas d’utilisation d’un DEA. Un DEA ne doit être utilisé que si la victime est inconsciente et ne respire pas normalement. Malgré toute la rigueur apportée au contenu du site aed-pointer.eu, les gestionnaires ne peuvent être tenus responsables des informations publiées ni de l’utilisation qui pourrait en être faite. D’une manière générale, les gestionnaires ne sauraient garantir ni l’exactitude ni l’exhaustivité des informations figurant sur ce site. L’utilisation de ce site et de son contenu incombe pleinement aux utilisateurs.<br /> La responsabilité des personnes ayant participé à la création, à la réalisation ou à la fourniture de ce site ne saurait être engagée en cas de dommages directs ou indirects résultant de l''accès à ce site, de son utilisation ou de l''impossibilité de l''utiliser, ou encore d''erreurs ou d’omissions dans son contenu. Les gestionnaires du site AED-POINTER ne sont pas responsable du contenu des sites Web et / ou d''autres expressions qui se réfèrent à ce site. <br /> <br /> Ce site utilise Google Maps, application cartographique fournie par Google Inc («Google»). L''utilisateur accepte les conditions d’utilisation de Google Maps. AED-POINTER n''accepte aucune responsabilité pour l''exactitude des cartes offertes, des lieux ainsi que des directions indiquées.', '', 1, 0, 0, 0, '2012-04-24 14:02:07', 62, '', '2012-10-22 12:19:16', 62, 0, '0000-00-00 00:00:00', '2012-04-24 14:02:07', '0000-00-00 00:00:00', '', '', 'show_title=1\nlink_titles=0\nshow_intro=0\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 11, 0, 6, '', '', 0, 862, 'robots=\nauthor='),
(22, 'Alerter, Masser, Choquer', 'alerter-masser-choquer', '', '<p>&nbsp;</p>\r\n<p><img src="images/stories/images/alerter.png" border="0" alt="alerter" style="border: 0pt none; float: left; margin-left: 20px; margin-right: 20px;" /></p>\r\n<p><strong>Reconnaître l’urgence<br />et Alerter le 112</strong><br /> <br />• Vérifier la conscience</p>\r\n<p style="padding-left: 90px;">• Basculer la tête de la victime en arrière</p>\r\n<p>• Alerter le 112 et répondre aux questions du Préposé<br /> <br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p><img src="images/stories/images/masser.png" border="0" alt="masser" style="border: 0pt none; float: left; margin-left: 20px; margin-right: 20px;" /></p>\r\n<p><strong>Effectuer des compressions&nbsp; thoraciques</strong> <br /><br />• Placer vos mains au centre du thorax<br /><br />• Enfoncer fermement le thorax <br /> - Minimum 5 cm de profondeur<br /> - Minimum 100 compressions/minute</p>\r\n<p>• Relâcher complètement le thorax entre<br /> chaque compression thoracique</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><img src="images/stories/images/laissez vous guider.jpg" border="0" width="287" height="148" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img src="images/stories/images/choquer.png" border="0" alt="choquer" style="border: 0pt none; float: left; margin-left: 20px; margin-right: 20px;" /></p>\r\n<p><strong>Utiliser un Défibrillateur Externe<br />Automatisé (DEA) pour administrer<br />un choc électrique si nécessaire</strong> <br /><br />• Activer le DEA dès qu’il est disponible</p>\r\n<p>• Suivre les instructions vocales du DEA <br />• S’aider des illustrations pour le<br /> positionnement des électrodes</p>\r\n<p><span style="font-size: x-small;"><br /></span></p>\r\n<p style="text-align: center;"><span style="font-size: x-small;">La présence d’un DEA est signalé par ce pictogramme :</span></p>\r\n<p style="text-align: center;"><span style="font-size: x-small;"><img src="images/stories/images/Pictogram_AED2.jpg" border="0" width="79" height="79" /></span></p>\r\n<p style="text-align: center;"><span style="font-size: x-small;"><br /></span></p>\r\n<p><span style="font-size: x-small;"><br /></span></p>\r\n<p><span style="font-size: x-small;"><br /></span></p>', '', 1, 0, 0, 0, '2008-08-11 22:13:58', 62, '', '2012-09-19 23:08:32', 62, 0, '0000-00-00 00:00:00', '2006-10-10 18:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=0\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 23, 0, 10, '', '', 0, 265, 'robots=\nauthor='),
(23, 'Platforms and Open Standards', 'platforms-and-open-standards', '', '<p class="MsoNormal">Joomla! runs on any platform including Windows, most flavours of Linux, several Unix versions, and the Apple OS/X platform.  Joomla! depends on PHP and the MySQL database to deliver dynamic content.  </p>            <p class="MsoNormal">The minimum requirements are:</p>      <ul><li>Apache 1.x, 2.x and higher</li><li>PHP 4.3 and higher</li><li>MySQL 3.23 and higher</li></ul>It will also run on alternative server platforms such as Windows IIS - provided they support PHP and MySQL - but these require additional configuration in order for the Joomla! core package to be successful installed and operated.', '', 0, 4, 0, 25, '2008-08-11 04:22:14', 62, '', '2008-08-11 04:22:14', 62, 62, '2012-07-30 19:41:12', '2006-10-10 08:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 7, 0, 4, '', '', 0, 11, 'robots=\nauthor='),
(24, 'Point coeur', 'point-coeur', '', '<p>Joomla! provides plenty of flexibility when displaying your Web content. Whether you are using Joomla! for a blog site, news or a Web site for a company, you''ll find one or more content styles to showcase your information. You can also change the style of content dynamically depending on your preferences. Joomla! calls how a page is laid out a <strong>layout</strong>. Use the guide below to understand which layouts are available and how you might use them.</p>\r\n<h2>Content</h2>\r\n<p>Joomla! makes it extremely easy to add and display content. All content  is placed where your mainbody tag in your template is located. There are three main types of layouts available in Joomla! and all of them can be customised via parameters. The display and parameters are set in the Menu Item used to display the content your working on. You create these layouts by creating a Menu Item and choosing how you want the content to display.</p>\r\n<h3>Blog Layout</h3>\r\n<p>Blog layout will show a listing of all Articles of the selected blog type (Section or Category) in the mainbody position of your template. It will give you the standard title, and Intro of each Article in that particular Category and/or Section. You can customise this layout via the use of the Preferences and Parameters, (See Article Parameters) this is done from the Menu not the Section Manager!</p>\r\n<p> </p>', '', 0, 4, 0, 29, '2008-08-12 22:33:10', 62, '', '2011-12-01 10:20:51', 62, 0, '0000-00-00 00:00:00', '2006-10-11 06:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 12, 0, 5, '', '', 0, 72, 'robots=\nauthor='),
(25, 'What are the requirements to run Joomla! 1.5?', 'what-are-the-requirements-to-run-joomla-15', '', '<p>Joomla! runs on the PHP pre-processor. PHP comes in many flavours, for a lot of operating systems. Beside PHP you will need a Web server. Joomla! is optimized for the Apache Web server, but it can run on different Web servers like Microsoft IIS it just requires additional configuration of PHP and MySQL. Joomla! also depends on a database, for this currently you can only use MySQL. </p>Many people know from their own experience that it''s not easy to install an Apache Web server and it gets harder if you want to add MySQL, PHP and Perl. XAMPP, WAMP, and MAMP are easy to install distributions containing Apache, MySQL, PHP and Perl for the Windows, Mac OSX and Linux operating systems. These packages are for localhost installations on non-public servers only.<br />The minimum version requirements are:<br /><ul><li>Apache 1.x or 2.x</li><li>PHP 4.3 or up</li><li>MySQL 3.23 or up</li></ul>For the latest minimum requirements details, see <a href="http://www.joomla.org/about-joomla/technical-requirements.html" target="_blank" title="Joomla! Technical Requirements">Joomla! Technical Requirements</a>.', '', 0, 3, 0, 31, '2008-08-11 00:42:31', 62, '', '2008-08-11 00:42:31', 62, 0, '0000-00-00 00:00:00', '2006-10-10 06:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 5, '', '', 0, 25, 'robots=\nauthor='),
(26, 'Alerter', 'alerter', '', '<p>Reconnaître l’urgence<br />et Alerter le 112<br /><br />Vérifier la conscience   <br />•<br />Basculer la tête de la victime en arrière<br />Vérifier la respiration pendant<br />maximum 10 secondes<br />•<br />Alerter le 112 et répondre aux<br />questions du Préposé<br /> <br /><br /></p>', '', -2, 0, 0, 0, '2008-08-11 06:00:00', 62, '', '2011-12-01 10:55:47', 62, 0, '0000-00-00 00:00:00', '2006-10-10 22:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=0\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 27, 0, 0, 'About Joomla!, General, Extensions', '', 0, 104, 'robots=\nauthor='),
(27, 'Choquer', 'choquer', '', '<p>Utiliser un Défibrillateur Externe<br />Automatisé (DEA) pour administrer<br />un choc électrique si nécessaire <br /><br />Activer le DEA dès qu’il est disponible<br />•<br />Suivre les instructions vocales du DEA<br />• <br />S’aider des illustrations pour le<br /> positionnement des électrodes</p>', '', -2, 0, 0, 0, '2008-08-12 16:50:48', 62, '', '2011-12-01 10:56:24', 62, 0, '0000-00-00 00:00:00', '2006-10-11 02:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=0\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 14, 0, 0, '', '', 0, 55, 'robots=\nauthor='),
(28, 'How do I install Joomla! 1.5?', 'how-do-i-install-joomla-15', '', '<p>Installing of Joomla! 1.5 is pretty easy. We assume you have set-up your Web site, and it is accessible with your browser.<br /><br />Download Joomla! 1.5, unzip it and upload/copy the files into the directory you Web site points to, fire up your browser and enter your Web site address and the installation will start.  </p><p>For full details on the installation processes check out the <a href="http://help.joomla.org/content/category/48/268/302" target="_blank" title="Joomla! 1.5 Installation Manual">Installation Manual</a> on the <a href="http://help.joomla.org" target="_blank" title="Joomla! Help Site">Joomla! Help Site</a> where you will also find download instructions for a PDF version too. </p>', '', 0, 3, 0, 31, '2008-08-11 01:10:59', 62, '', '2008-08-11 01:10:59', 62, 0, '0000-00-00 00:00:00', '2006-10-10 06:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 5, 0, 3, '', '', 0, 5, 'robots=\nauthor=');
INSERT INTO `jos_content` (`id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`) VALUES
(29, 'What is the purpose of the collation selection in the installation screen?', 'what-is-the-purpose-of-the-collation-selection-in-the-installation-screen', '', 'The collation option determines the way ordering in the database is done. In languages that use special characters, for instance the German umlaut, the database collation determines the sorting order. If you don''t know which collation you need, select the "utf8_general_ci" as most languages use this. The other collations listed are exceptions in regards to the general collation. If your language is not listed in the list of collations it most likely means that "utf8_general_ci is suitable.', '', 0, 3, 0, 32, '2008-08-11 03:11:38', 62, '', '2008-08-11 03:11:38', 62, 0, '0000-00-00 00:00:00', '2006-10-10 08:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=', 4, 0, 4, '', '', 0, 6, 'robots=\nauthor='),
(30, 'What languages are supported by Joomla! 1.5?', 'what-languages-are-supported-by-joomla-15', '', 'Within the Installer you will find a wide collection of languages. The installer currently supports the following languages: Arabic, Bulgarian, Bengali, Czech, Danish, German, Greek, English, Spanish, Finnish, French, Hebrew, Devanagari(India), Croatian(Croatia), Magyar (Hungary), Italian, Malay, Norwegian bokmal, Dutch, Portuguese(Brasil), Portugues(Portugal), Romanian, Russian, Serbian, Svenska, Thai and more are being added all the time.<br />By default the English language is installed for the Back and Front-ends. You can download additional language files from the <a href="http://extensions.joomla.org" target="_blank" title="Joomla! Extensions Directory">Joomla!Extensions Directory</a>. ', '', 0, 3, 0, 32, '2008-08-11 01:12:18', 62, '', '2008-08-11 01:12:18', 62, 0, '0000-00-00 00:00:00', '2006-10-10 06:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 5, 0, 2, '', '', 0, 8, 'robots=\nauthor='),
(31, 'Is it useful to install the sample data?', 'is-it-useful-to-install-the-sample-data', '', 'Well you are reading it right now! This depends on what you want to achieve. If you are new to Joomla! and have no clue how it all fits together, just install the sample data. If you don''t like the English sample data because you - for instance - speak Chinese, then leave it out.', '', 0, 3, 0, 27, '2008-08-11 09:12:55', 62, '', '2008-08-11 09:12:55', 62, 0, '0000-00-00 00:00:00', '2006-10-10 10:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 3, '', '', 0, 3, 'robots=\nauthor='),
(32, 'Where is the Static Content Item?', 'where-is-the-static-content', '', '<p>In Joomla! versions prior to 1.5 there were separate processes for creating a Static Content Item and normal Content Items. The processes have been combined now and whilst both content types are still around they are renamed as Articles for Content Items and Uncategorized Articles for Static Content Items. </p><p>If you want to create a static item, create a new Article in the same way as for standard content and rather than relating this to a particular Section and Category just select <span style="font-style: italic">Uncategorized</span> as the option in the Section and Category drop down lists.</p>', '', 0, 3, 0, 28, '2008-08-10 23:13:33', 62, '', '2008-08-10 23:13:33', 62, 0, '0000-00-00 00:00:00', '2006-10-10 04:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 6, '', '', 0, 5, 'robots=\nauthor='),
(33, 'What is an Uncategorised Article?', 'what-is-uncategorised-article', '', 'Most Articles will be assigned to a Section and Category. In many cases, you might not know where you want it to appear so put the Article in the <em>Uncategorized </em>Section/Category. The Articles marked as <em>Uncategorized </em>are handled as static content.', '', 0, 3, 0, 31, '2008-08-11 15:14:11', 62, '', '2008-08-11 15:14:11', 62, 0, '0000-00-00 00:00:00', '2006-10-10 12:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 2, '', '', 0, 6, 'robots=\nauthor='),
(34, 'Does the PDF icon render pictures and special characters?', 'does-the-pdf-icon-render-pictures-and-special-characters', '', 'Yes! Prior to Joomla! 1.5, only the text values of an Article and only for ISO-8859-1 encoding was allowed in the PDF rendition. With the new PDF library in place, the complete Article including images is rendered and applied to the PDF. The PDF generator also handles the UTF-8 texts and can handle any character sets from any language. The appropriate fonts must be installed but this is done automatically during a language pack installation.', '', 0, 3, 0, 32, '2008-08-11 17:14:57', 62, '', '2008-08-11 17:14:57', 62, 0, '0000-00-00 00:00:00', '2006-10-10 14:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 7, 0, 3, '', '', 0, 6, 'robots=\nauthor='),
(35, 'Is it possible to change A Menu Item''s Type?', 'is-it-possible-to-change-the-types-of-menu-entries', '', '<p>You indeed can change the Menu Item''s Type to whatever you want, even after they have been created. </p><p>If, for instance, you want to change the Blog Section of a Menu link, go to the Control Panel-&gt;Menus Menu-&gt;[menuname]-&gt;Menu Item Manager and edit the Menu Item. Select the <strong>Change Type</strong> button and choose the new style of Menu Item Type from the available list. Thereafter, alter the Details and Parameters to reconfigure the display for the new selection  as you require it.</p>', '', 0, 3, 0, 31, '2008-08-10 23:15:36', 62, '', '2008-08-10 23:15:36', 62, 0, '0000-00-00 00:00:00', '2006-10-10 04:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 1, '', '', 0, 18, 'robots=\nauthor='),
(36, 'Where did the Installers go?', 'where-did-the-installer-go', '', 'The improved Installer can be found under the Extensions Menu. With versions prior to Joomla! 1.5 you needed to select a specific Extension type when you wanted to install it and use the Installer associated with it, with Joomla! 1.5 you just select the Extension you want to upload, and click on install. The Installer will do all the hard work for you.', '', 0, 3, 0, 28, '2008-08-10 23:16:20', 62, '', '2008-08-10 23:16:20', 62, 0, '0000-00-00 00:00:00', '2006-10-10 04:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 1, '', '', 0, 4, 'robots=\nauthor='),
(37, 'Where did the Mambots go?', 'where-did-the-mambots-go', '', '<p>Mambots have been renamed as Plugins. </p><p>Mambots were introduced in Mambo and offered possibilities to add plug-in logic to your site mainly for the purpose of manipulating content. In Joomla! 1.5, Plugins will now have much broader capabilities than Mambots. Plugins are able to extend functionality at the framework layer as well.</p>', '', 0, 3, 0, 28, '2008-08-11 09:17:00', 62, '', '2008-08-11 09:17:00', 62, 0, '0000-00-00 00:00:00', '2006-10-10 10:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 5, '', '', 0, 4, 'robots=\nauthor='),
(38, 'I installed with my own language, but the Back-end is still in English', 'i-installed-with-my-own-language-but-the-back-end-is-still-in-english', '', '<p>A lot of different languages are available for the Back-end, but by default this language may not be installed. If you want a translated Back-end, get your language pack and install it using the Extension Installer. After this, go to the Extensions Menu, select Language Manager and make your language the default one. Your Back-end will be translated immediately.</p><p>Users who have access rights to the Back-end may choose the language they prefer in their Personal Details parameters. This is of also true for the Front-end language.</p><p> A good place to find where to download your languages and localised versions of Joomla! is <a href="http://extensions.joomla.org/index.php?option=com_mtree&task=listcats&cat_id=1837&Itemid=35" target="_blank" title="Translations for Joomla!">Translations for Joomla!</a> on JED.</p>', '', 0, 3, 0, 32, '2008-08-11 17:18:14', 62, '', '2008-08-11 17:18:14', 62, 0, '0000-00-00 00:00:00', '2006-10-10 14:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 7, 0, 1, '', '', 0, 7, 'robots=\nauthor='),
(39, 'How do I remove an Article?', 'how-do-i-remove-an-article', '', '<p>To completely remove an Article, select the Articles that you want to delete and move them to the Trash. Next, open the Article Trash in the Content Menu and select the Articles you want to delete. After deleting an Article, it is no longer available as it has been deleted from the database and it is not possible to undo this operation.  </p>', '', 0, 3, 0, 27, '2008-08-11 09:19:01', 62, '', '2008-08-11 09:19:01', 62, 0, '0000-00-00 00:00:00', '2006-10-10 10:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 2, '', '', 0, 4, 'robots=\nauthor='),
(40, 'What is the difference between Archiving and Trashing an Article? ', 'what-is-the-difference-between-archiving-and-trashing-an-article', '', '<p>When you <em>Archive </em>an Article, the content is put into a state which removes it from your site as published content. The Article is still available from within the Control Panel and can be <em>retrieved </em>for editing or republishing purposes. Trashed Articles are just one step from being permanently deleted but are still available until you Remove them from the Trash Manager. You should use Archive if you consider an Article important, but not current. Trash should be used when you want to delete the content entirely from your site and from future search results.  </p>', '', 0, 3, 0, 27, '2008-08-11 05:19:43', 62, '', '2008-08-11 05:19:43', 62, 0, '0000-00-00 00:00:00', '2006-10-10 06:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 1, '', '', 0, 5, 'robots=\nauthor='),
(41, 'Newsflash 5', 'newsflash-5', '', 'Joomla! 1.5 - ''Experience the Freedom''!. It has never been easier to create your own dynamic Web site. Manage all your content from the best CMS admin interface and in virtually any language you speak.', '', 0, 1, 0, 3, '2008-08-12 00:17:31', 62, '', '2008-08-12 00:17:31', 62, 0, '0000-00-00 00:00:00', '2006-10-11 06:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 5, 0, 2, '', '', 0, 7, 'robots=\nauthor='),
(42, 'Le projet', 'le-projet', '', '<p><br /><strong>Améliorez la survie après un arrêt cardiaque </strong><br /><br />- Reconnaître l’urgence et alerter le 112<br /><br />- Masser vite et fort<br /><br />- Choquer avec un Défibrillateur<br /> Externe automatisé<br /><br /><strong>OSER SAUVER!</strong></p>\r\n<p> </p>\r\n<p><img src="images/stories/images/ligne.png" border="0" width="512" height="64" /></p>', '', 1, 0, 0, 0, '2008-08-12 00:25:50', 62, '', '2011-12-06 09:06:53', 62, 62, '2012-07-30 19:39:56', '2006-10-11 06:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=0\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 12, 0, 9, '', '', 0, 55, 'robots=\nauthor='),
(43, 'Le projet', 'le-projet', '', '<p><br />Améliorez la survie après<br />un arrêt cardiaque <br /><br />- Reconnaître l’urgence et alerter le 112<br /><br />- Masser vite et fort<br /><br />- Choquer avec un Défibrillateur<br />Externe automatisé<br /><br />OSER SAUVER!</p>', '', -2, 0, 0, 0, '2008-08-12 09:26:52', 62, '', '2011-12-01 10:28:32', 62, 0, '0000-00-00 00:00:00', '2006-10-11 10:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=0\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 9, 0, 0, 'Uncategorized, Uncategorized, Example Pages and Menu Links', '', 0, 43, 'robots=\nauthor='),
(44, 'Joomla! Security Strike Team', 'joomla-security-strike-team', '', '<p>The Joomla! Project has assembled a top-notch team of experts to form the new Joomla! Security Strike Team. This new team will solely focus on investigating and resolving security issues. Instead of working in relative secrecy, the JSST will have a strong public-facing presence at the <a href="http://developer.joomla.org/security.html" target="_blank" title="Joomla! Security Center">Joomla! Security Center</a>.</p>', '<p>The new JSST will call the new <a href="http://developer.joomla.org/security.html" target="_blank" title="Joomla! Security Center">Joomla! Security Center</a> their home base. The Security Center provides a public presence for <a href="http://developer.joomla.org/security/news.html" target="_blank" title="Joomla! Security News">security issues</a> and a platform for the JSST to <a href="http://developer.joomla.org/security/articles-tutorials.html" target="_blank" title="Joomla! Security Articles">help the general public better understand security</a> and how it relates to Joomla!. The Security Center also offers users a clearer understanding of how security issues are handled. There''s also a <a href="http://feeds.joomla.org/JoomlaSecurityNews" target="_blank" title="Joomla! Security News Feed">news feed</a>, which provides subscribers an up-to-the-minute notification of security issues as they arise.</p>', 0, 1, 0, 1, '2007-07-07 09:54:06', 62, '', '2007-07-07 09:54:06', 62, 0, '0000-00-00 00:00:00', '2004-07-06 22:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 3, '', '', 0, 1, 'robots=\nauthor='),
(45, 'L’arrêt cardiaque... nous sommes tous concernés !', 'larret-cardiaque-nous-sommes-tous-concernes-', '', '<p><img src="images/stories/images/osersauver_visuel_rvb.jpg" border="0" alt="oser sauver" width="393" height="299" style="border: 0pt none; vertical-align: baseline;" /></p>\r\n<p><strong><br />En Europe, 700.000 personnes décèdent chaque année d’un arrêt cardiaque.</strong><br /><br />Actuellement, les chances de survie après un arrêt cardiaque sont de 8%.<br />L’intervention précoce d’un témoin permettrait de dépasser 60%.<br /><br /> La prise en charge par un témoin avant l’arrivée des secours est donc<br />primordiale. Ces personnes ont besoin de vous...</p>\r\n<p><img src="images/stories/images/ligne.png" border="0" width="456" height="57" /></p>', '', 0, 0, 0, 0, '2007-07-07 09:54:06', 62, '', '2011-12-06 09:04:58', 62, 62, '2012-09-12 12:17:30', '2004-07-06 22:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=0\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 17, 0, 8, '', '', 0, 5, 'robots=\nauthor='),
(49, 'Liens', 'liens', '', '<p>&nbsp;</p>\r\n<p><a href="http://emurgency.eu/" target="_blank"><img src="images/stories/images/EMuRgency_Logo_2.jpg" alt="EMuRgency" width="264" height="70" /></a></p>\r\n<p><a href="https://www.erc.edu/index.php/mainpage/en/" title="erc"><img src="images/stories/images/logo.png" width="264" alt="ERC" /></a></p>\r\n<p>&nbsp;</p>\r\n<p><a href="http://www.resuscitation.be/fr/home/" target="_blank"><img src="images/stories/logo brc nouveau.bmp" alt="BRC" width="264" /></a></p>\r\n<p>&nbsp;</p>\r\n<p><a href="http://www.oser-sauver.eu" target="_blank"><img src="images/stories/oser sauver_logo_v.121125.jpg" width="270" /></a></p>', '', 1, 0, 0, 0, '2012-09-03 12:03:46', 62, '', '2013-07-17 08:54:31', 62, 0, '0000-00-00 00:00:00', '2012-09-03 12:03:46', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 4, '', '', 0, 865, 'robots=\nauthor='),
(50, 'Hot new''s', 'hot-news', '', '<p style="color: #565656; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, sans-serif; font-size: 13px; line-height: 17px;"><span style="font-family: ''arial black'', ''avant garde''; font-size: small;">EMuRgency project has happened</span></p>\r\n<p style="color: #565656; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, sans-serif; font-size: 13px; line-height: 17px;">On 7th and 8th of February the second consortium meeting for the EMuRgency project has happened. The partners have discussed the state of the project andeach activity leader has presented the work done by the consortium members. In an open space session all partners had the opportunity to discuss ideas and concepts for the activities.</p>\r\n', '\r\n<p> </p>\r\n<p style="color: #565656; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, sans-serif; font-size: 13px; line-height: 17px;"><a href="http://www.flickr.com/photos/brighton/4695552616/" title="Aachen Cathedral - Germany. by Jim Linwood, on Flickr" style="color: #0000cc; text-decoration: underline; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, sans-serif; font-size: 13px; line-height: 17px;"><img src="http://farm5.staticflickr.com/4012/4695552616_dbb8604453.jpg" border="0" alt="Aachen Cathedral - Germany." style="width: 180px; height: 240px; float: left; margin-left: 10px; margin-right: 10px;" /></a>First approaches towards the setup of a stakeholder-network in the region have been discussed. An integrated PR strategy based on stakeholder needs and different communication channels has been further refinded. The outcome of the meeting are refined tasks and responsibilities in all activities and a more concrete long-term planning for the first project year.</p>\r\n<p style="color: #565656; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, sans-serif; font-size: 13px; line-height: 17px;">A session about efficient communication in the activity groups and administrative issues has rounded up the meeting.</p>\r\n<p style="color: #565656; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, sans-serif; font-size: 13px; line-height: 17px;"><br />The project meeting has been organized by the partners from Aachen (ZLW-IMA RWTH Aachen/University Hospital Aachen).</p>', -2, 0, 0, 0, '2012-09-04 11:38:53', 62, '', '2012-09-04 11:54:48', 62, 0, '0000-00-00 00:00:00', '2012-09-04 11:38:53', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 8, 0, 0, '', '', 0, 1, 'robots=\nauthor='),
(51, 'pop up ', 'pop-up-', '', '<p><span style="font-family: Arial, Helvetica, sans-serif; line-height: 18px;"><a href="http://www.aed-pointer.eu/index.php?option=com_content&amp;view=article&amp;id=18&amp;Itemid=57" onclick="window.open(''http://www.aed-pointer.eu/index.php?option=com_content&amp;view=article&amp;id=18&amp;Itemid=57'',''info'',''width=735,height=156,left=''+(screen.availWidth/2-367.5)+'',top=''+(screen.availHeight/2-78)+'''');"><img src="images/stories/pop up-01.png" border="0" /></a></span></p>', '', 0, 0, 0, 0, '2012-09-12 09:10:15', 62, '', '2012-09-13 12:40:51', 62, 0, '0000-00-00 00:00:00', '2012-09-12 09:10:15', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 4, 0, 2, '', '', 0, 2, 'robots=\nauthor='),
(52, 'Soutenez AED-Pointer ', 'soutenez-aed-pointer-', '', '<p><a href="index.php?option=com_content&amp;view=article&amp;id=52:soutenez-aed-pointer-&amp;catid=38:actualites&amp;Itemid=68&amp;lang=fr"><img src="images/stories/news_like.png" alt="I like aed-pointer" width="190" /></a></p>\r\n<p><a href="index.php?option=com_content&amp;view=article&amp;id=52:soutenez-aed-pointer-&amp;catid=38:actualites&amp;Itemid=68&amp;lang=fr"></a>', '</p>\r\n<p><strong><span style="font-size: 14pt;"><br /></span></strong></p>\r\n<p><strong><span style="font-size: 14pt;">Soutenez-nous grâce à Facebook</span></strong></p>\r\n<p><span style="font-size: 12pt;">cliquez "j''aime" en bas de page !</span></p>', 1, 1, 0, 38, '2012-09-12 11:20:15', 62, '', '2012-11-20 15:30:33', 62, 0, '0000-00-00 00:00:00', '2012-09-12 11:20:15', '0000-00-00 00:00:00', '', '', 'show_title=1\nlink_titles=1\nshow_intro=\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=\nkeyref=\nreadmore=', 12, 0, 8, '', '', 0, 1112, 'robots=\nauthor='),
