(56, 'Achetez et utilisez un DEA !', 'achetez-et-utilisez-un-dea-', '', '<p class="p1"><b><a href="index.php?option=com_content&amp;view=article&amp;id=56:achetez-et-utilisez-un-dea-&amp;catid=38:actualites&amp;Itemid=68&amp;lang=fr"><img src="images/stories/achat dea.png" alt="achat DEA" width="190" /></a></b></p>\r\n', '\r\n<p><b>Commune&nbsp;? Association&nbsp;? En 2013, un marché stock de la Province de Liège vous équipe de Défibrillateurs Externes Automatisés au meilleur prix&nbsp;!</b></p>\r\n<p class="p1">Le Collège provincial propose un achat collectif aux 84 communes et CPAS de la province, mais aussi aux établissements sportifs, aux mouvements de jeunesses et à tous types d’associations situés sur son territoire. Le but est d’effectuer un achat groupé<b> </b>de Défibrillateurs Externes Automatisés <b>(DEA ou AED en anglais),</b> en 2013, afin de bénéficier d’avantages supplémentaires.&nbsp;</p>\r\n<p class="p1">Présenté pour un coût <b>maximal de 1.750 € TVAC, </b>le <b>pack provincial</b> comprend&nbsp;:</p>\r\n<ul class="ul1">\r\n<li class="li1"><b>un </b><span class="s1"><b>DEA full-automatique IP54</b><b>&nbsp;;</b>&nbsp;</span></li>\r\n<li class="li1">une armoire avec système local d’alarme intégré (non relié au 112).</li>\r\n</ul>\r\n<p class="p1">En complément, la <b>Province de Liège</b>, amie des communes, <b>offre</b>, par pack commandé&nbsp;:</p>\r\n<ul class="ul1">\r\n<li class="li1">une <b>journée de formation</b> à l’utilisation d’un DEA dispensée par <span class="s1">l’Ecole Provinciale d’Aide Médicale Urgente (EPAMU)&nbsp;;</span></li>\r\n<li class="li1">des exemplaires d’une <span class="s1">brochure informative&nbsp;à la formation et à l’utilisation des DEA&nbsp;;</span></li>\r\n<li class="li1">pour la signalétique, <span class="s1">des pictogrammes directionnels conformes à la législation en vigueur.&nbsp;</span></li>\r\n</ul>\r\n<p class="p1">Vous représentez un organisme sportif&nbsp;? Vous pouvez solliciter l’octroi d’une subvention, <span class="s1">sous certaines conditions, auprès de la <span class="s1">Fédération Wallonie-Bruxelles.&nbsp;</span></span></p>\r\n<p class="p1"><b>Vous aussi, vous voulez sauver des vies&nbsp;?&nbsp;</b></p>\r\n<p class="p1">à <a href="mailto:sophie.arts@provincedeliege.be">sophie.arts@provincedeliege.be</a> ou au 04/344.79.35, Direction générale du</p>\r\n<p class="p1"><b>Vous voulez en savoir plus&nbsp;?&nbsp;</b></p>\r\n<p class="p1">Consultez les<span class="s1"> clauses techniques du cahier spécial des charges 2013 de la Province de Liège</span></p>\r\n<p class="p1"><b>Liens Hypertexte</b></p>\r\n<ul class="ul1">\r\n<li class="li3"><b>Un DEA full-automatique IP 54&nbsp;</b></li>\r\n</ul>\r\n<p class="p1"><b>Texte joint à placer. &nbsp;</b></p>\r\n<ul class="ul1">\r\n<li class="li1"><b>Ecole Provinciale d’Aide Médicale Urgente (EPAMU)</b></li>\r\n</ul>\r\n<p class="p1"><a href="http://www3.provincedeliege.be/formation/spip.php?page=epamu">http://www3.provincedeliege.be/formation/spip.php?page=epamu</a></p>\r\n<ul class="ul1">\r\n<li class="li1"><b>Brochure</b></li>\r\n</ul>\r\n<p class="p2">En cours de réalisation</p>\r\n<ul class="ul1">\r\n<li class="li1"><b>Picto</b></li>\r\n</ul>\r\n<p class="p2">En cours de réalisation</p>\r\n<ul class="ul1">\r\n<li class="li1"><b>Sous certaines conditions</b></li>\r\n</ul>\r\n<p class="p2"><a href="http://www.adeps.be/pdf/achat%20consolid%C3%A9%202012.pdf">http://www.adeps.be/pdf/achat%20consolid%C3%A9%202012.pdf</a></p>\r\n<ul class="ul1">\r\n<li class="li3"><b>Fédération Wallonie-Bruxelles</b></li>\r\n</ul>\r\n<p class="p3">Direction générale du Sport – Service Subventions</p>\r\n<p class="p1">Monsieur PANIURA</p>\r\n<p class="p1">Boulevard Léopold II 44&nbsp;</p>\r\n<p class="p1">1080<span class="Apple-tab-span"> BRUXELLES</span></p>\r\n<p class="p1">Tél.&nbsp;: 02/ 413 28 50</p>\r\n<p class="p1">Fax&nbsp;: 02/ 413 31 45&nbsp;</p>\r\n<p class="p1">Mail&nbsp;: <a href="mailto:jorgeluis.paniuraflores@cfwb.be">jorgeluis.paniuraflores@cfwb.be</a></p>\r\n<p class="p1">www.aes-asbl.be</p>\r\n<ul class="ul1">\r\n<li class="li3"><b>Département Santé et Qualité de Vie</b></li>\r\n</ul>\r\n<p class="p3"><a href="http://www.provincedeliege.be/portail/fr/competences/sante_qualite_de_vie">http://www.provincedeliege.be/portail/fr/competences/sante_qualite_de_vie</a></p>\r\n<ul class="ul1">\r\n<li class="li3"><b>Clauses techniques cahier des charges</b></li>\r\n</ul>\r\n<p class="p3">En cours de rédaction.&nbsp;</p>', 1, 1, 0, 38, '2012-11-20 14:25:38', 62, '', '2012-11-26 08:55:47', 62, 0, '0000-00-00 00:00:00', '2012-11-20 14:25:38', '0000-00-00 00:00:00', '', '', 'show_title=1\nlink_titles=1\nshow_intro=1\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=fr-FR\nkeyref=\nreadmore=', 15, 0, 6, '', '', 0, 1131, 'robots=\nauthor='),
(54, 'Un site web pour comparer les DEA...', 'un-site-web-pour-comparer-les-dea', '', '<p class="p1"><a href="index.php?option=com_content&amp;view=article&amp;id=54:un-site-web-pour-comparer-les-dea&amp;catid=38:actualites&amp;Itemid=68&amp;lang=fr"><img src="images/stories/differents dea.png" alt="differents dea" width="190" /></a></p>\r\n', '\r\n<p class="p1">Vous éprouvez des difficultés à vous y retrouver dans le labyrinthe des DEA ...</p>\r\n<p class="p2">Voici un site qui pourra peut-être vous aider...</p>\r\n<p class="p3"><a href="http://www.compareaed.eu/">http://www.compareaed.eu/</a></p>', 0, 1, 0, 38, '2012-09-19 11:09:03', 62, '', '2012-11-20 15:29:45', 62, 0, '0000-00-00 00:00:00', '2012-09-19 11:09:03', '0000-00-00 00:00:00', '', '', 'show_title=1\nlink_titles=1\nshow_intro=1\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=fr-FR\nkeyref=\nreadmore=', 13, 0, 7, 'http://www.compareaed.eu/', '', 0, 862, 'robots=\nauthor='),
(55, 'Achat groupé de DEA en Province de Liège', 'achat-groupe-de-dea-en-province-de-liege', '', '<p class="p1"><b><img src="images/stories/images/logo_ilcor.jpg" alt="" /></b></p>\r\n', '\r\n<p class="p1"><b><br /></b></p>\r\n<p class="p1"><b>Participation à l’achat groupé 2013 de Défibrillateurs Externes Automatisés (DEA).</b></p>\r\n<p class="p2">&nbsp;En juin dernier, vous avez reçu un courrier de la Province de Liège concernant une proposition de participation à l’achat groupé, pour 2013, de Défibrillateurs Externes Automatisés (DEA).&nbsp;</p>\r\n<p class="p2">&nbsp;Nombre d’entre vous ont déjà répondu par l’affirmative&nbsp;!</p>\r\n<p class="p2">&nbsp;Vos réactions favorables confortent le Collège provincial dans l’idée que cette nouvelle action, dans sa politique d’aide aux communes, n’est pas dénuée de sens.&nbsp;</p>\r\n<p class="p2">&nbsp;En parcourant le site internet <span class="s1">aed-pointer.eu, découvrez où se situe, en&nbsp; province de Liège, un des 200 DEA sur les 400 que compte la Belgique. Vous aussi équipez-vous grâce à l’offre avantageuse de la Province de Liège&nbsp;!&nbsp;</span></p>\r\n<p class="p2">&nbsp;Le présent courrier contient les précisions relatives aux modalités pratiques de participation à ce nouveau marché public d’achat.&nbsp;</p>\r\n<p class="p2">&nbsp;Le Conseil Européen de Réanimation recommande la mise à disposition et l’utilisation de DEA. Et, dans le cas d’une mise à disposition dans des lieux publics où un très large public devrait être capable d’utiliser cet appareil, la version full-automatique, et donc de procédure extrêmement simplifiée, est recommandée par le Service des urgences du Centre Hospitalier de l’Université de Liège. &nbsp;</p>\r\n<p class="p2">&nbsp;Le marché sera valable pour toute l’année 2013.&nbsp;</p>\r\n<p class="p2">&nbsp;Le « pack&nbsp;», proposé pour un coût actuellement <b>estimé à environ 1.750 € TVAC, </b>comprendra&nbsp;:&nbsp;</p>\r\n<ul class="ul1">\r\n<li class="li1"><b>un défibrillateur externe automatisé full-automatique avec un indice de protection IP54 minimum</b>&nbsp;(qui permet son utilisation dans des milieux où il pourrait être éclaboussé);</li>\r\n<li class="li1">une <b>armoire avec système local d’alarme intégré</b> (non relié au 112).</li>\r\n</ul>\r\n<p class="p2">&nbsp;En complément <b>la</b> <b>Province de Liège</b>, amie des communes, <b>offrira</b>, par pack commandé :&nbsp;</p>\r\n<ul class="ul1">\r\n<li class="li3"><span class="s2">une journée de formation à l’utilisation d’un DEA dispensée par l’Ecole Provinciale d’Aide Médicale Urgente (EPAMU)&nbsp;;</span></li>\r\n<li class="li4">un porte-clés contenant un masque de protection faciale pour la pratique du bouche à bouche (en Réanimation Cardio-Pulmonaire) ;&nbsp;</li>\r\n<li class="li1">des exemplaires d’une brochure informative&nbsp;à la formation et à l’utilisation des DEA&nbsp;;</li>\r\n<li class="li1">pour la signalétique, des pictogrammes directionnels.&nbsp;</li>\r\n</ul>\r\n<p class="p2">&nbsp;Nous vous invitons à prendre connaissance des clauses techniques précises du cahier des charges reprises en annexe.&nbsp;</p>\r\n<p class="p2">&nbsp;Les demandes supplémentaires entraineront automatiquement des coûts supplémentaires qui seront à charge des participants demandeurs. &nbsp;</p>\r\n<p class="p2">&nbsp;La facturation sera individuelle pour permettre notamment aux établissements sportifs de solliciter la subvention de la Fédération Wallonie-Bruxelles.&nbsp;</p>\r\n<p class="p2">&nbsp;Ainsi, concernant l’éventuel octroi, par la Fédération Wallonie-Bruxelles, d’une subvention de 75% du prix du matériel que les organismes sportifs <span class="s2">(Fédérations, cercles, centres sportifs, etc.) peuvent solliciter et dont question dans l’Arrêté du Gouvernement de la Communauté française du 19 janvier 2001 fixant les conditions d’octroi des subventions pour l’achat de matériel sportif et plus particulièrement son article 5bis (Acquisition de DEA de catégorie 1), nous vous invitons à contacter Monsieur Charles ANNEZ dont vous trouverez les coordonnées ci-dessous&nbsp;:&nbsp;</span></p>\r\n<p class="p5">&nbsp;Ministère de la Fédération Wallonie-Bruxelles</p>\r\n<p class="p3">Direction générale du Sport – Service Subventions</p>\r\n<p class="p3">Boulevard Léopold II 44 - 1080 Bruxelles</p>\r\n<p>Tél.&nbsp;: 02/ 413 28 49 -&nbsp;Fax&nbsp;: 02/ 413 31 45&nbsp;</p>\r\n<p class="p6"><span class="s3">Mail&nbsp;: <span class="s1"><a href="mailto:charles.annez@cfwb.be">charles.annez@cfwb.be</a></span></span></p>\r\n<p class="p7">&nbsp;Dans l’hypothèse où un établissement sportif souhaite se joindre au marché stock provincial, celui-ci devra donc, pour pouvoir éventuellement bénéficier de la subvention de la Fédération Wallonie-Bruxelles, respecter la procédure de demande telle que visée aux articles 9 et suivants de l’arrêté précité, à savoir notamment attendre l’envoi de l’accusé de réception&nbsp; de l’administration de la FWB avant de passer la commande, sous peine de rejet de la demande.</p>\r\n<p class="p2">&nbsp;Cet établissement sportif devra également préciser dans sa demande qu’il ne consultera pas lui-même plusieurs fournisseurs, mais que le DEA sera fourni par l’attributaire du marché public organisé par la Province de Liège qui <span class="s4">dispensera une facturation individuelle, une condition indispensable pour que la demande de cette subvention soit recevable et ce en plus des conditions prévues dans l’arrêté.&nbsp;</span></p>\r\n<p class="p5">&nbsp;Nous comptons sur vous pour relayer cette information au sein de votre Commune !&nbsp;</p>\r\n<p class="p2">&nbsp;Pour ce faire, nous vous invitons à prendre les contacts utiles avec votre CPAS, vos établissements sportifs, vos mouvements de jeunesse et toutes autres associations afin de centraliser les demandes éventuelles de DEA sur votre commune.</p>\r\n<p class="p2">&nbsp;Nous vous invitons donc, si vous marquez votre accord sur cette proposition, à nous faire connaître par écrit, <b>pour le 30 novembre 2012</b>, le nombre de DEA que votre entité souhaite acquérir, à l’adresse suivante : Direction générale de la Santé de la Province de Liège, quai du Barbou 4 à 4020 LIEGE.&nbsp;</p>\r\n<p class="p2">&nbsp;Pour toutes informations complémentaires, vous pouvez contacter la Direction générale de la Santé de la Province de Liège au numéro suivant : 04/344.79.35 ou via l’adresse mail <a href="mailto:sophie.arts@provincedeliege.be.">sophie.arts@provincedeliege.be.</a>&nbsp;</p>\r\n<p class="p2">&nbsp;<b>Plus la commande sera importante et plus l’offre deviendra intéressante !</b></p>\r\n<p class="p2">&nbsp;<b>La Province de Liège, amie des communes, est à nouveau là pour vous aider à acquérir un DEA à moindre coût !</b></p>\r\n<p class="p2">&nbsp;Convaincus que vous serez sensibles à cette nouvelle initiative, nous vous prions d’agréer, Madame, Monsieur, l’assurance de nos sentiments les meilleurs.</p>\r\n<p class="p2">&nbsp;<b>Pour le Collège provincial :</b></p>\r\n<p class="p1">Par délégation du Député provincial - Président,</p>\r\n<p class="p1">(Article L2213-1du CDLD)</p>\r\n<p class="p2">&nbsp;<b>Marianne LONHAY</b><span class="Apple-tab-span"> <span class="Apple-tab-span"> <span class="Apple-tab-span"> <b>Christophe LACROIX <span class="Apple-tab-span"> <span class="Apple-tab-span"> Georges PIRE</span></span></b>&nbsp;</span></span></span></p>\r\n<p class="p1">Greffière provinciale<span class="Apple-tab-span"> <span class="Apple-tab-span"> <span class="Apple-tab-span"> Député provincial<span class="Apple-tab-span"> <span class="Apple-tab-span"> Député provincial-Vice-président</span></span></span></span></span></p>', 0, 1, 0, 38, '2012-09-19 11:19:05', 62, '', '2012-09-19 12:55:48', 62, 0, '0000-00-00 00:00:00', '2012-09-19 11:19:05', '0000-00-00 00:00:00', '', '', 'show_title=1\nlink_titles=1\nshow_intro=0\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=fr-FR\nkeyref=\nreadmore=', 5, 0, 9, '', '', 0, 6, 'robots=\nauthor='),
(57, 'Un DEA, c’est quoi ?', 'un-dea-full-automatique-cest-quoi-et-pour-quoi-faire-', '', '<div class="column">\r\n<p><span style="font-family: Verdana; font-size: 13px; font-weight: bold; line-height: 20px;"><a href="index.php?option=com_content&amp;view=article&amp;id=57:un-dea-full-automatique-cest-quoi-et-pour-quoi-faire-&amp;catid=38:actualites&amp;Itemid=68&amp;lang=fr"><img src="images/stories/news_dea.png" alt="dea" width="190" /></a></span></p>\r\n<p>&nbsp;</p>\r\n', '\r\n<p><span style="font-family: Verdana; font-size: 13px; font-weight: bold; line-height: 20px;"><br /></span></p>\r\n<p><span style="font-family: Verdana; font-size: 13px; font-weight: bold; line-height: 20px;">Un&nbsp;</span><span style="font-family: Verdana; font-size: 10pt; font-weight: bold;">Défibrillateur Externe Automatisé </span><span style="font-size: 10pt; font-family: Verdana;">(DEA ou AED en anglais) est un appareil portable, fonctionnant au moyen d’une batterie, de la taille d’une sacoche. Son utilisation est extrêmement simple.</span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Le DEA permet d’intervenir auprès d’une personne victime d’un malaise avec perte de connaissance et arrêt respiratoire dont l’origine est, le plus souvent, cardiaque. </span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Dans nos pays industrialisés, c’est la cause la plus fréquente de décès survenant de façon soudaine. En Belgique, chaque année, 11.000 personnes <span style="font-size: 10pt; font-family: Verdana;">sont victimes d’un accident cardiaque avec fibrillation ventriculaire. </span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">La meilleure réaction face à ce dérèglement de l’activité électrique du cœur (ou trouble du rythme) est l’administration d’un choc électrique ou <span style="font-size: 10pt; font-family: Verdana;">défibrillation. </span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Ultra performant, le DEA a pour rôle d’analyser le rythme cardiaque <span style="font-size: 10pt; font-family: Verdana;">afin de diagnostiquer les arythmies qui nécessitent la délivrance de chocs <span style="font-size: 10pt; font-family: Verdana;">électriques. </span></span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Parmi les défibrillateurs, les appareils <span style="font-size: 10pt; font-family: Verdana; font-weight: bold;">full-automatiques <span style="font-size: 10pt; font-family: Verdana;">interviennent <span style="font-size: 10pt; font-family: Verdana;">seuls dans la prise de décision de délivrance d’une défibrillation. Ils sont donc <span style="font-size: 10pt; font-family: Verdana;">utilisables par tous car extrêmement simples ! </span></span></span></span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Le Conseil Européen de Réanimation recommande l’utilisation de <span style="font-size: 10pt; font-family: Verdana;">Défibrillateurs Externes Automatisés avec une mise à disposition la plus large <span style="font-size: 10pt; font-family: Verdana;">possible.</span></span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Chaque nouvelle minute qui passe réduit les chances de survie de 10% <span style="font-size: 10pt; font-family: Verdana;">à 15% ! Il convient d’agir au plus vite ! </span></span></p>\r\n</div>\r\n<div class="column">\r\n<p><span style="font-size: 10pt; font-family: Verdana;">L’appel à l’aide médicale urgente - c’est-à-dire l’appel au secours au numéro 112 - doit systématiquement et légalement accompagner l’utilisation de l’un de ces appareils, l’intervention passant dès lors automatiquement sous responsabilité médicale. </span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Actuellement, seulement 8% des victimes en réchappent.<br /> Mais, les chances de survie peuvent dépasser 60 % si les 4 étapes de la</span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;"><span style="font-size: 10pt; font-family: Verdana; font-weight: bold;">chaîne&nbsp;</span></span><span style="font-family: Verdana; font-size: 10pt; font-weight: bold;">de survie </span><span style="font-size: 10pt; font-family: Verdana;">sont enclenchées dans les premières secondes :</span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">– Alerter les secours (112)<br /> – Pratiquer un massage cardiaque (une réanimation cardio-pulmonaire)<br /> <span style="font-size: 10pt; font-family: Verdana;">– Pratiquer si nécessaire une défibrillation le plus vite possible (à l’aide d’un DEA) <span style="font-size: 10pt; font-family: Verdana;">– Administrer rapidement des soins spécialisés par des professionnels</span></span></span></p>\r\n<p><span style="font-size: 16pt; font-family: Verdana; font-style: italic;">Osez sauver ! Osez poser « les bons gestes » !&nbsp;</span></p>\r\n</div>', -2, 1, 0, 38, '2012-11-20 15:46:52', 62, '', '2012-11-26 08:55:30', 62, 0, '0000-00-00 00:00:00', '2012-11-20 15:46:52', '0000-00-00 00:00:00', '', '', 'show_title=1\nlink_titles=1\nshow_intro=0\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=fr-FR\nkeyref=\nreadmore=', 12, 0, 0, '', '', 0, 489, 'robots=\nauthor=');
