(58, '300 DEA gratuits pour les clubs sportifs !', 'un-dea-full-automatique-cest-quoi-et-pour-quoi-faire-', '', '<div class="column">\r\n<p><img src="images/stories/news_aes.png" alt="" /></p>\r\n<p>&nbsp;</p>\r\n', '\r\n<p><span style="font-family: Verdana; font-size: 13px; font-weight: bold; line-height: 20px;"><br /></span></p>\r\n<h1 class="entry-title" style="color: #333333; font-family: Tahoma, Arial, Verdana; font-weight: normal; margin: 0px 0px 15px; padding: 0px; font-size: 20px; line-height: 18px;">Nouvelle action de distribution de 300 DEA aux clubs sportifs !</h1>\r\n<div class="entry-content" style="color: #333333; font-family: Tahoma; font-size: 12px; line-height: 18px;">\r\n<h3 style="color: #cf152a; font-family: Tahoma, Arial, Verdana; font-weight: normal; margin: 0px 0px 5px; padding: 0px; font-size: 14px;"><span style="color: #ff0000;">Nouvelle action de distribution de 300 DEA aux clubs sportifs !</span></h3>\r\n<p style="margin: 0px; padding: 0px 0px 10px;"><span style="color: #ff0000;">300 DEA distribués gratuitement aux clubs sportifs</span></p>\r\n<p style="margin: 0px; padding: 0px 0px 10px;">L’Association Interfédérale du Sport Francophone (AISF) vous informe que, dans le cadre du renforcement de la sécurité des infrastructures sportives et des clubs sportifs, l’Association des Etablissements Sportifs (AES), avec le soutien du Ministre des Sports de la Fédération Wallonie-Bruxelles, met à nouveau 300 défibrillateurs externes automatisés (DEA) à disposition des clubs sportifs.</p>\r\n<p style="margin: 0px; padding: 0px 0px 10px;">Les clubs sportifs situés en Fédération Wallonie-Bruxelles ont récemment reçu un courrier émanant de l’Association des Etablissements Sportifs (AES) relatif à cette distribution gratuite de 300 DEA.</p>\r\n<p style="margin: 0px; padding: 0px 0px 10px;">Afin de prétendre à l’obtention d’un de ces 300 appareils, les clubs doivent impérativement renvoyer le formulaire dûment complété, par courrier recommandé à l’AES avant le 15 juin 2013, le cachet de la poste faisant foi.<br />Le courrier et le formulaire de demande relatifs à cette action sont disponibles sur le site de l’AES.</p>\r\n<p style="margin: 0px; padding: 0px 0px 10px;">Cette nouvelle action sera certainement une des dernières permettant aux clubs qui n’évoluent toujours pas dans une infrastructure équipée d’un DEA de satisfaire à l’obligation fixée au 31 décembre 2013, figurant dans le Décret de la Communauté française du 25 octobre 2012 relatif&nbsp;à la présence de défibrillateurs externes automatiques de catégorie 1 dans les infrastructures sportives.</p>\r\n<p style="margin: 0px; padding: 0px 0px 10px;">L’AISF invite donc les clubs a rapidement rentrer une demande d’obtention d’un DEA auprès de <a href="http://www.aes-asbl.be/cd_securite_dea_dis_300dea.html" target="_blank">l’AES</a>.</p>\r\n</div>\r\n</div>', -2, 1, 0, 38, '2012-11-20 15:46:52', 62, '', '2013-06-03 09:21:02', 62, 0, '0000-00-00 00:00:00', '2012-11-20 15:46:52', '0000-00-00 00:00:00', '', '', 'show_title=1\nlink_titles=1\nshow_intro=0\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=fr-FR\nkeyref=\nreadmore=', 1, 0, 0, '', '', 0, 3, 'robots=\nauthor='),
(59, '300 ', 'un-dea-full-automatique-cest-quoi-et-pour-quoi-faire-', '', '<div class="column">\r\n<p><img src="images/stories/news_aes.png" alt="" /></p>\r\n<p>&nbsp;</p>\r\n', '\r\n<p><span style="font-family: Verdana; font-size: 13px; font-weight: bold; line-height: 20px;"><br /></span></p>\r\n<h1 class="entry-title" style="color: #333333; font-family: Tahoma, Arial, Verdana; font-weight: normal; margin: 0px 0px 15px; padding: 0px; font-size: 20px; line-height: 18px;">Nouvelle action de distribution de 300 DEA aux clubs sportifs !</h1>\r\n<div class="entry-content" style="color: #333333; font-family: Tahoma; font-size: 12px; line-height: 18px;">\r\n<h3 style="color: #cf152a; font-family: Tahoma, Arial, Verdana; font-weight: normal; margin: 0px 0px 5px; padding: 0px; font-size: 14px;"><span style="color: #ff0000;">Nouvelle action de distribution de 300 DEA aux clubs sportifs !</span></h3>\r\n<p style="margin: 0px; padding: 0px 0px 10px;"><span style="color: #ff0000;">300 DEA distribués gratuitement aux clubs sportifs</span></p>\r\n<p style="margin: 0px; padding: 0px 0px 10px;">L’Association Interfédérale du Sport Francophone (AISF) vous informe que, dans le cadre du renforcement de la sécurité des infrastructures sportives et des clubs sportifs, l’Association des Etablissements Sportifs (AES), avec le soutien du Ministre des Sports de la Fédération Wallonie-Bruxelles, met à nouveau 300 défibrillateurs externes automatisés (DEA) à disposition des clubs sportifs.</p>\r\n<p style="margin: 0px; padding: 0px 0px 10px;">Afin de prétendre à l’obtention d’un de ces 300 appareils, les clubs doivent impérativement renvoyer le formulaire dûment complété, par courrier recommandé à l’AES avant le 15 juin 2013, le cachet de la poste faisant foi.<br />Le courrier et le formulaire de demande relatifs à cette action sont disponibles sur le site de l’AES.</p>\r\n<p style="margin: 0px; padding: 0px 0px 10px;">Cette nouvelle action sera certainement une des dernières permettant aux clubs qui n’évoluent toujours pas dans une infrastructure équipée d’un DEA de satisfaire à l’obligation fixée au 31 décembre 2013, figurant dans le Décret de la Communauté française du 25 octobre 2012 relatif&nbsp;à la présence de défibrillateurs externes automatiques de catégorie 1 dans les infrastructures sportives.</p>\r\n<p style="margin: 0px; padding: 0px 0px 10px;">L’AISF invite donc les clubs a rapidement rentrer une demande d’obtention d’un DEA auprès de <a href="http://www.aes-asbl.be/cd_securite_dea_dis_300dea.html" target="_blank">l’AES</a>.</p>\r\n</div>\r\n</div>', -2, 1, 0, 38, '2012-11-20 15:46:52', 62, '', '2013-06-03 09:58:41', 62, 0, '0000-00-00 00:00:00', '2012-11-20 15:46:52', '0000-00-00 00:00:00', '', '', 'show_title=1\nlink_titles=1\nshow_intro=0\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=fr-FR\nkeyref=\nreadmore=', 1, 0, 0, '', '', 0, 1, 'robots=\nauthor='),
(60, 'C''est quoi un DEA ?', 'cest-quoi-un-dea-', '', '<p class="p1"><b><a href="index.php?option=com_content&amp;view=article&amp;id=56:achetez-et-utilisez-un-dea-&amp;catid=38:actualites&amp;Itemid=68&amp;lang=fr"><img src="images/stories/news_dea.png" alt="news_dea" width="280" height="201" /></a></b></p>\r\n', '\r\n<div class="column">\r\n<p><span style="font-family: Verdana; font-size: 13px; font-weight: bold; line-height: 20px;">Un&nbsp;<span style="font-family: Verdana; font-size: 10pt; font-weight: bold;">Défibrillateur Externe Automatisé&nbsp;<span style="font-size: 10pt; font-family: Verdana;">(DEA ou AED en anglais) est un appareil portable, fonctionnant au moyen d’une batterie, de la taille d’une sacoche. Son utilisation est extrêmement simple.</span></span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Le DEA permet d’intervenir auprès d’une personne victime d’un malaise avec perte de connaissance et arrêt respiratoire dont l’origine est, le plus souvent, cardiaque.</span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Dans nos pays industrialisés, c’est la cause la plus fréquente de décès survenant de façon soudaine. En Belgique, chaque année, 11.000 personnes&nbsp;<span style="font-size: 10pt;">sont victimes d’un accident cardiaque avec fibrillation ventriculaire.</span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">La meilleure réaction face à ce dérèglement de l’activité électrique du cœur (ou trouble du rythme) est l’administration d’un choc électrique ou&nbsp;<span style="font-size: 10pt;">défibrillation.</span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Ultra performant, le DEA a pour rôle d’analyser le rythme cardiaque&nbsp;<span style="font-size: 10pt;">afin de diagnostiquer les arythmies qui nécessitent la délivrance de chocs&nbsp;<span style="font-size: 10pt;">électriques.</span></span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Parmi les défibrillateurs, les appareils&nbsp;<span style="font-size: 10pt; font-weight: bold;">full-automatiques&nbsp;<span style="font-size: 10pt;">interviennent&nbsp;<span style="font-size: 10pt;">seuls dans la prise de décision de délivrance d’une défibrillation. Ils sont donc&nbsp;<span style="font-size: 10pt;">utilisables par tous car extrêmement simples !</span></span></span></span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Le Conseil Européen de Réanimation recommande l’utilisation de&nbsp;<span style="font-size: 10pt;">Défibrillateurs Externes Automatisés avec une mise à disposition la plus large&nbsp;<span style="font-size: 10pt;">possible.</span></span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Chaque nouvelle minute qui passe réduit les chances de survie de 10%&nbsp;<span style="font-size: 10pt;">à 15% ! Il convient d’agir au plus vite !</span></span></p>\r\n</div>\r\n<div class="column">\r\n<p><span style="font-size: 10pt; font-family: Verdana;">L’appel à l’aide médicale urgente - c’est-à-dire l’appel au secours au numéro 112 - doit systématiquement et légalement accompagner l’utilisation de l’un de ces appareils, l’intervention passant dès lors automatiquement sous responsabilité médicale.</span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">Actuellement, seulement 8% des victimes en réchappent.<br />Mais, les chances de survie peuvent dépasser 60 % si les 4 étapes de la</span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;"><span style="font-size: 10pt; font-weight: bold;">chaîne&nbsp;<span style="font-family: Verdana; font-size: 10pt; font-weight: bold;">de survie&nbsp;<span style="font-size: 10pt; font-family: Verdana;">sont enclenchées dans les premières secondes :</span></span></span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana;">– Alerter les secours (112)<br />– Pratiquer un massage cardiaque (une réanimation cardio-pulmonaire)<br /><span style="font-size: 10pt;">– Pratiquer si nécessaire une défibrillation le plus vite possible (à l’aide d’un DEA)&nbsp;<span style="font-size: 10pt;">– Administrer rapidement des soins spécialisés par des professionnels</span></span></span></p>\r\n<p><span style="font-size: 16pt; font-family: Verdana; font-style: italic;">Osez sauver ! Osez poser « les bons gestes » !&nbsp;</span></p>\r\n</div>', 1, 1, 0, 38, '2012-11-20 14:25:38', 62, '', '2013-06-03 10:18:16', 62, 0, '0000-00-00 00:00:00', '2012-11-20 14:25:38', '0000-00-00 00:00:00', '', '', 'show_title=1\nlink_titles=1\nshow_intro=1\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=0\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=0\nshow_print_icon=0\nshow_email_icon=0\nlanguage=fr-FR\nkeyref=\nreadmore=', 1, 0, 2, '', '', 0, 595, 'robots=\nauthor='),
