(640, 'OFFICES DU TOURISME', 'offices-du-tourisme', 'Zeedijk 26a', '', 'Sint Idesbald', '', '8670', '', '', '', '', '', '', '', 0, '<p>POSITION :</p>\r\n<p>situé&nbsp;<span style="line-height: 1.5;">sur la gauche du bâtiment,&nbsp;</span><span style="line-height: 1.5;">en bas des escaliers.</span></p>', '', '', '', 0, '', '', 1, 'http://img33.imageshack.us/img33/6831/pointeurombre.png', '2.6106664999', '51.1115631', '18', 34, 62, 1, 0, '', '', 29),
(641, 'INSTITUT SAINTE THERESE D''AVILA', 'institut-sainte-therese-davila', 'Rue Soeur Lutgardis,5', '', 'Chênéé', '', '4032', '', '+32(0)43618585', '', '', 'd.diduca@istachenee.be', '', '', 0, '<p>POSITION : situé dans le h<span style="line-height: 1.5;">all d''entrée principal, à côté du bureau d''accueil et de l''armoire incendie.</span></p>\r\n<p>&nbsp;</p>\r\n<hr class="system-pagebreak" />\r\n<p><span style="line-height: 1.5;">DISPONIBILITÉ : L</span><span style="line-height: 1.5;">undi - Mardi - Jeudi - Vendredi de 07h30 à 17h00 ; Mercredi de 07h30 à 15h00.<br />Fermé en période de congé scolaire.</span></p>', '', '', '', 0, '', '', 1, 'http://img33.imageshack.us/img33/6831/pointeurombre.png', '5.6190405496', '50.612942727', '19', 34, 62, 1, 0, '', '', 28),
(651, 'AMTSGERICHT JÜLICH', 'amtsgericht-juelich', ' Wilhelmstraße 15', '', 'Jülich', '', '52428', '', '02461/681-0', '', '', 'verwaltung@ag-juelich.nrw.de', '', 'ag_juelich.jpg', 0, '<p class="p1">AED hängt in der Wachtmeisterei.&nbsp;</p>\r\n<p class="p1">Tage und Uhrzeiten der Zugänglichkeit : Öffnungszeiten montags bis freitags siehe <a href="http://ag-juelich.nrw.de/"><span class="s1">http://ag-juelich.nrw.de</span></a></p>', '', '', '', 0, '', '', 1, 'http://img33.imageshack.us/img33/6831/pointeurombre.png', '6.3657534153', '50.922808318', '19', 34, 62, 1, 0, '', '', 18),
(642, 'STADT WÜRSELEN', 'stadt-wuerselen', 'Morlaixplatz 1', '', 'Würselen', '', '52146', '', '', '', '', '', '', '', 0, '<p class="p1">KOMMENTAR : AED im EG.</p>', '', '', '', 0, '', '', 1, 'http://img33.imageshack.us/img33/6831/pointeurombre.png', '6.1299199999', '50.81953', '10', 34, 62, 1, 0, '', '', 27),
