(148, 3, 48, 'content', 'introtext', 'DISCLAIMER<br /> <br />\r\n<ul class="ul1">\r\n<li class="li1">Wanneer u een AED gaat gebruiken, zorg dan dat u contact heeft met de meldkamer (bel 112).</li>\r\n<li class="li1">Een AED mag alleen worden gebruikt wanneer het slachtoffer buiten bewustzijn is en niet (normaal) ademt.&nbsp;</li>\r\n<li class="li1">Ondanks dat de beheerders van aed-pointer.eu actuele en betrouwbare informatie nastreven, kunnen deze niet verantwoordelijk worden gehouden voor de gepubliceerde informatie of voor het gebruik van de data van de website.&nbsp;</li>\r\n<li class="li1">De beheerders kunnen noch de nauwkeurigheid/betrouwbaarheid noch de volledigheid van de informatie, genoemd op deze website, garanderen.&nbsp;</li>\r\n<li class="li1">Het gebruiken van de website en diens inhoud geschiedt op eigen risico van de gebruiker.&nbsp;</li>\r\n<li class="li1">De personen die een bijdrage leveren aan deze service kunnen niet verantwoordelijk worden gehouden in geval van directe of indirecte schade ten gevolge van het betreden van de website, het gebruik daarvan, of van errors of uitlatingen van de inhoud&nbsp;</li>\r\n<li class="li1">De beheerders van website www.aed-pointer.eu zijn niet verantwoordelijk voor de inhoud van de website en / of andere uitingen die verwijzen naar de&nbsp;website.</li>\r\n<li class="li1">\r\n<p class="p1">Deze site maakt gebruik van Google Maps, een kaarten applicatie aangeboden door Google Inc. De gebruiker accepteert de voorwaarden voor het gebruik van Google Maps. AED-Pointer is niet verantwoordelijk voor de nauwkeurigheid van de aangeboden kaarten, plaatsen en getoonde routes.&nbsp;</p>\r\n</li>\r\n</ul>', '65927a7a6e0df539650d82b95f1581c7', '', '2012-10-16 12:32:55', 62, 1),
