g src="images/stories/province%20de%20liege_logo.jpg" width="190" height="72" alt="province de liege_logo" style="font-size: 16px; line-height: 24px;" /></a><span style="font-size: 16px; line-height: 24px;">&nbsp; &nbsp; &nbsp;</span><a href="http://www.wallonie.be/" target="_blank"><img src="images/stories/wallonie_logo.jpg" width="100" height="138" alt="wallonie_logo" /></a>&nbsp; &nbsp; &nbsp;<span style="font-size: 16px; line-height: 24px;"><a href="http://www.vlaamsbrabant.be/fr/" target="_blank"><img src="images/stories/vlaams%20brabant_logo.png" width="130" height="133" alt="vlaams brabant_logo" /></a>&nbsp; &nbsp; <a href="http://www.limburg.be/" target="_blank"><img src="images/stories/provincie%20limburg%20be.gif" width="195" height="81" alt="provincie limburg be" /></a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><a href="http://www.wirtschaft.nrw.de/" target="_blank"><img src="images/stories/nordrhein%20westfalen_logo.jpg" width="230" height="44" alt="nordrhein westfalen_logo" /></a>&nbsp; &nbsp; &nbsp;<a href="http://www.limburg.nl/" target="_blank"><img src="images/stories/limburg%20provincie_logo.jpg" width="230" height="46" alt="limburg provincie_logo" /></a>&nbsp; &nbsp; <span style="font-size: 16px; line-height: 24px;">&nbsp; &nbsp; &nbsp;</span><a href="http://celstec.org/" target="_blank"><img src="images/stories/celstec_logo.png" width="245" height="58" alt="celstec_logo" /></a></p>\r\n<p><span style="font-size: 16px; line-height: 24px;"><br /></span></p>', 'aadaff33d1421a8691310fcb8b8ba870', '', '2012-10-18 12:46:07', 62, 1),
