(323, 4, 48, 'content', 'introtext', '<p>RECHTLICHE HINWEISE</p>\r\n<p class="p1">Stellen Sie sicher, dass Sie einen Notruf abgesetzt haben, wenn Sie einen AED einsetzen.&nbsp;Ein AED darf nur genutzt werden, wenn Sie eine bewusstlose Person vor sich haben, die nicht normal atmet.&nbsp;Auch wenn die Personen hinter AED-Pointer aktuelle und zuverlässige Informationen anstreben, können diese nicht verantwortlich gemacht werden für die veröffentlichten Informationen oder die Nutzung der Daten.&nbsp;Die Verantwortlichen für diese Seite können nicht die Zuverlässigkeit oder Vollständigkeit dieser Informationen garantieren. Die Nutzung dieser Webseite ist somit vollständig in der Verantwortlichkeit der Nutzer.Die Verantwortlichen der Website können nicht haftbar gemacht werden für die Nutzung dieser Webseite oder durch fehlerhafte oder fehlende Daten. Die Administratoren der Website www.aed-pointer.eu sind nicht verantwortlich für die Inhalte der Webseite oder den Inhalt anderer Seiten, die auf diese Webseite verweisen.</p>\r\n<p class="p2">Diese Seite benutzt Google Maps, ein Kartendienst der Firma Google Inc. (“Google”). Die Nutzer akzeptieren die&nbsp;</p>', '65927a7a6e0df539650d82b95f1581c7', '', '2012-10-18 12:50:50', 62, 1),
