(404, 1, 48, 'content', 'introtext', '<p class="p1">DISCLAIMER</p>\r\n<p class="p2">The 112 Alert centre should be informed each time an AED is used.&nbsp;An AED may only be used if the victim is unconscious and does not breath normally.&nbsp;Although the people behind aed-pointer.eu strive for reliable and up-to-date information, the administrators cannot be made responsible of the information’s published, or for the use of the data from website.&nbsp;In general, the administrators cannot guarantee nor the accuracy nor the exhaustiveness of the information mentioned on this website.&nbsp;The use of this website and its’ content is fully the responsibility of users.&nbsp;The people who contribute to this service are not liable in case of direct or indirect damage resulting from the access to this website, from its use, or from errors or omissions in its content.&nbsp; The administrators of the site www.aed-pointer.eu are not responsible for the contents of the websites and/or for the other expressions which refer to the site.</p>\r\n<p class="p2">This site uses Google Maps, a cartographic application provide by Google Inc. (“Google”). The user accepts the conditions of use of Google Maps.&nbsp; AED-Pointer holds no responsibility for the accuracy of the offered maps, the places as well as indicated directions.</p>', '65927a7a6e0df539650d82b95f1581c7', '', '2012-10-22 10:08:32', 62, 1),
